import {enumerate} from "./enum";

export const ItemType = enumerate(['SHORTSWORD', 'LONGSWORD', 'SCIMITAR', 'BOW', 'AXE', 'DAGGER', 'SHIELD']);
export const ItemAttr = enumerate(['IRON', 'STEEL', 'DAMASCUS', 'STABILIZED', 'REINFORCED']);

export const ItemMap = {
    'SHORTSWORD': {damage: 10, cooldown: 1, image: 'data:image/jpeg;base64,'},
    'LONGSWORD': {damage: 18, cooldown: 2, image: 'data:image/jpeg;base64,'},
    'SCIMITAR': {damage: 15, cooldown: 1, image: 'data:image/jpeg;base64,'},
    'BOW': {damage: 15, cooldown: 1, image: 'data:image/png;base64,'},
    'AXE': {damage: 25, cooldown: 2, image: 'data:image/jpeg;base64,'},
    'DAGGER': {damage: 12, cooldown: 0, image: 'data:image/jpeg;base64,'},
    'SHIELD': {damage: 0, cooldown: 2, image: 'https://gamepedia.cursecdn.com/skyrim_gamepedia/3/36/NordicShieldofBlocking.png'}
};

const AttrMap = {
    'IRON': {damage: 5, cooldown: 0},
    'STEEL': {damage: 10, cooldown: 0},
    'DAMASCUS': {damage: 20, cooldown: 2},
    'STABILIZED': {damage: 12, cooldown: 0},
    'REINFORCED': {damage: 0, cooldown: 1}
};

export class Item {
    constructor(item, itemType, itemAttr) {
        if (item) {
            [this.itemType, this.itemAttr, this.cooldown, this.damage, this.currentCooldown] = item;
        } else {
            this.itemType = itemType;
            this.itemAttr = itemAttr;
            this.cooldown = ItemMap[itemType].cooldown + ItemAttr[itemAttr].cooldown;
            this.damage = ItemMap[itemType].damage + ItemAttr[itemAttr].damage;
            this.currentCooldown = 0;
        }
    }

    set currentCooldown(cooldown) {
        this.currentCooldown = cooldown;
    }

    get currentCooldown() {
        return this.currentCooldown;
    }

    set damage(damage) {
        this.damage = damage;
    }

    get damage() {
        return this.damage;
    }

    set cooldown(cooldown) {
        this.cooldown = cooldown;
    }

    get cooldown() {
        return this.cooldown;
    }

    set itemType(itemType) {
        this.type = itemType;
    }

    get itemType() {
        return this.itemType;
    }

    set itemAttr(itemAttr) {
        this.itemAttr = itemAttr;
    }

    get itemAttr() {
        return this.itemAttr;
    }
}
